import '../../css/Login.css';
import eoffice from './../../images/logo.png';
import {Link} from 'react-router-dom';
import fpt from '../../images/fpt.png';
import support from '../../images/support.png';
import {Alert, Button, Col,Row, Container, Form, FormGroup, Input} from 'reactstrap';
import { useEffect, useState } from 'react';
import loginAPI from '../../api/loginAPI';

function Login(){
    const [getData, setGetData] =useState({
        username: '',
        password: '',
    })

    function handleGetData(e){
        const target = e.target;
        const name = target.name;
        const value = target.value;
        setGetData({
            ... getData,
            [name] : value,
        })
    }

    function handleSubmit(){
        useEffect(()=>{
            const params = {
                username: getData.username,
                password: getData.password
            }
            async function fetchUser(){
                try {
                    const response = await loginAPI.loginUser()
                } catch (error) {

                }
            }
        })
    }
    return(
            <Container fluid={true}>
                <Row>
                    <Col>
                        <div className="fpt">
                            <img src={fpt} alt="" width="350px" height="200px"/>
                            <h1>MANAGEMENT & CONTRACT</h1>
                            <p style={{color:'white', fontSize:'30px'}}>DOCUMENT SYSTEM</p>
                            <img style={{marginTop:'70%', marginRight:'90%'}} src={support} alt="" width="500" height="100"/>
                        </div>
                    </Col>
                    <Col>
                        <Form className="form-login">
                            <FormGroup>
                                <img src={eoffice} alt=""/>
                            </FormGroup>
                            <FormGroup>
                                <Input type="text" name="username" onChange={handleGetData} placeholder="Username"/>
                            </FormGroup>
                            <FormGroup>
                                <Input type="password" name="password" onChange={handleGetData} placeholder="Password"/>
                            </FormGroup>
                            <FormGroup className="form-forgot">
                                <Link to="/forgot-password">Forgot password?</Link>
                            </FormGroup>
                            <FormGroup>
                                <Alert isOpen={false} color="danger">Incorrect username or password</Alert>
                            </FormGroup>
                            <FormGroup>
                                <Button color="primary" type="submit" block>Sign In</Button>
                            </FormGroup>
                        </Form>
                    </Col>

                </Row>

            </Container>
    );
}
export default Login;
